import React from 'react'
import './PortfolioCard.css'

export const PortfolioCard = () => {
  return (
    <div className='portfolio-card-container'>
        <div className='portfolio-image'>
            <img src={require('../assets/work_1.jpg')} alt="" />
        </div>
    </div>
  )
}
